import React from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);

  }

  render() {
    return (
      <div className="App">
        <div>
         <button>
          Run
        </button>
        </div>
        <div>
          <input type="checkbox" />
        </div>
      </div>
    );
  }
}


export default App;
